import {makeAutoObservable} from "mobx"
import UserProfil from "./UserProfil";


export default class UsersConteiner{
    constructor(){
        this._users = [];
        makeAutoObservable(this)
    }

    setUsers(users){
        users = users.map(temp => temp = {
            id: temp.id,
            user: new UserProfil(temp.id,temp.fn,temp.sn,temp.img,temp.email,0,0,temp.role == 'ADMIIN',temp.text) })
        this._users = users
    }

    get users(){
        return this._users
    }
    

}
